import React from 'react';
import './App.css';
import Masthead from '../MastHead/MastHead.js'
import '@patternfly/react-core/dist/styles/base.css';
import {
  Text
} from '@patternfly/react-core';


class App extends React.Component {
  render() {
    const header = {
      height: 60,
      width: 302,
      color:'#0E0E0E',
      font: "Red Hat Display",
      fontSize: 24,
      fontWeight: 500,
      letterSpacing: 0,
      lineHeight:3,
      textIndent:20
    };
    return (
      <div>
        <Masthead></Masthead>
        <div style={header}> 
        Events of the Week
        </div>
      </div>
    );
  }
}

export default App;
